import React from 'react'
import './Todo.css'

const Todo =({todo}) =>{

  let count = 0;
  const counter = ()=>{
      count+=1;
  };

  console.log(todo.completed);
  return (
    <div className='todo-card'>
      <div className='todo-card-container'>
        <h1>{count}</h1>
      <h1 className='todo-card-title'>{todo.title.toString().slice(0,49)}</h1>
      <p className='todo-card-body'>{todo.completed}</p>
      </div>
    </div>
  )
}

export default Todo
